import React from "react"
import { createBrowserRouter, RouterProvider, Route, Outlet } from "react-router-dom"

import ContentPage from "./ContentPage" // Import the ContentPage component

// Other imports...

const Layout = () => {
  return (
    <>
      <Header />
      <Navbar />
      <Outlet />
      <Footer />
    </>
  )
}

const router = createBrowserRouter([
  {
    path: "/",
    element: <Layout />,
    children: [
      // Other routes...
      {
        path: "/:pathName", // Dynamic path parameter
        element: <ContentPage /> // Render ContentPage for all paths
      }
    ]
  }
])

function App() {
  return (
    <div className="app">
      <div className="container">
        <RouterProvider router={router} />
      </div>
    </div>
  )
}

export default App
